# NOTE: The encoded variable below is the "Windows (dark).deskthemepack" file

$DarkThemeLocation = "C:\Windows\Resources\Themes\dark.theme"
$IsWindows10 = ((Get-CimInstance -ClassName Win32_OperatingSystem).Caption).StartsWith("Microsoft Windows 10")
if ($IsWindows10) {
  $DarkThemeLocation = "C:\Windows\Resources\Themes\Windows (dark).deskthemepack"
  $base64DarkThemeWin10 = ""
  $decodedDarkThemeWin10 = [System.Convert]::FromBase64CharArray($base64DarkThemeWin10, 0, $base64DarkThemeWin10.Length)
  [System.IO.File]::WriteAllBytes($DarkThemeLocation, $decodedDarkThemeWin10)
}
Start-Process $DarkThemeLocation -Wait
"systemsettings","explorer" | % { Stop-Process -Name $_ -Force ; Wait-Process -Name $_ }
Start-Process "explorer"
$Shell = New-Object -ComObject Shell.Application
While (-Not ($Shell.Windows()).Count) { Start-Sleep -Milliseconds 1 }
$Shell.Windows() | % { $_.quit() }
